  \"2013-03-28T01:13:49.293789\",\n\t\"name\": \"minnesota-land-use-and-cover-a-1990s-census-of-the-land-tiled\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set integrates six different
  source data sets to provide a simplified overall view of Minnesota's land use /
  cover. The six source data sets covered different parts of the state, were in differing
  formats, and used different legend classifications. MnDNR developed a simplified
  8-category legend and translated each source data set's original detailed classification
  into the 8-category system. They also standardized the data to 30 meter grid cells.
  The data set was used to produce a 43 inch by 50 inch wall map of the same title.\",\n\t\"license_title\":
